var title_f19_11_19645="Drugs and doses for pharmacological conversion of AF";
var content_f19_11_19645=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F74104&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F74104&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Drugs and doses for pharmacological conversion of (recent-onset) AF (European Society of Cardiology)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose",
"       </td>",
"       <td class=\"subtitle1\">",
"        Follow-up dose",
"       </td>",
"       <td class=\"subtitle1\">",
"        Risks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Amiodarone",
"        </strong>",
"       </td>",
"       <td>",
"        5 mg/kg IV over 1 hour",
"       </td>",
"       <td>",
"        50 mg per hour",
"       </td>",
"       <td>",
"        Phlebitis, hypotension. Will slow the ventricular rate. Delayed AF conversion to sinus rhythm.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Flecainide",
"        </strong>",
"       </td>",
"       <td>",
"        2 mg/kg IV over 10 minutes, or 200 to 300 mg orally",
"       </td>",
"       <td>",
"        N/A",
"       </td>",
"       <td>",
"        Not suitable for patients with marked structural heart disease; may prolong QRS duration, and hence the QT interval; and may inadvertently increase the ventricular rate due to conversion to atrial flutter and 1:1 conduction to the ventricles.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Ibutilide",
"        </strong>",
"       </td>",
"       <td>",
"        1 mg IV over 10 minutes",
"       </td>",
"       <td>",
"        1 mg IV over 10 minutes after waiting for 10 minutes",
"       </td>",
"       <td>",
"        Can cause prolongation of the QT interval and torsades de pointes; watch for abnormal T-U waves or QT prolongation. Will slow the ventricular rate.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Propafenone",
"        </strong>",
"       </td>",
"       <td>",
"        2 mg/kg IV over 10 minutes, or 450 to 600 mg orally",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Not suitable for patients with marked structural heart disease; may prolong QRS duration; will slightly slow the ventricular rate, but may inadvertently increase the ventricular rate due to conversion to atrial flutter and 1:1 conduction to the ventricles.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Vernakalant",
"        </strong>",
"       </td>",
"       <td>",
"        3 mg/kg IV over 10 minutes",
"       </td>",
"       <td>",
"        Second infusion of 2 mg/kg IV over 10 minutes after 15 minute rest",
"       </td>",
"       <td>",
"        So far only evaluated in clinical trials; recently approved.*",
"        <sup>",
"         [1-3]",
"        </sup>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Vernakalant has recently been recommended for approval by the European Medicines Agency for rapid cardioversion of recent-onset AF to sinus rhythm in adults (&ge;7 days for non-surgical patients; &ge;3 days for surgical patients).",
"     <sup>",
"      [1,2]",
"     </sup>",
"     A direct comparison with amiodarone in the AVRO trial (Phase III prospective, randomized, double-blind, active-controlled, multi-center, superiority study of Vernakalant injection versus amiodarone in subjects with recent onset atrial fibrillation), vernakalant was more effective than amiodarone for the rapid conversion of AF to sinus rhythm (51.7 percent versus 5.7 percent at 90 min after the start of treatment; p&lt;0.0001).",
"     <sup>",
"      [3]",
"     </sup>",
"     It is to be given as an initial IV infusion (3 mg/kg over 10 minutes), followed by 15 minutes of observation and a further IV infusion (2 mg/kg over 10 minutes), if necessary. Vernakalant is contraindicated in patients with systolic blood pressure &lt;100 mmHg, severe aortic stenosis, heart failure (class NYHA III and IV), ACS within the previous 30 days, or QT interval prolongation. Before its use, the patients should be adequately hydrated. ECG and hemodynamic monitoring should be used, and the infusion can be followed by DC cardioversion if necessary. The drug is not contraindicated in patients with stable coronary artery disease, hypertensive heart disease, or mild heart failure. The clinical positioning of this drug has not yet been determined, but it is likely to be used for acute termination of recent-onset AF in patients with lone AF or AF associated with hypertension, coronary artery disease, or mild to moderate (NYHA class I-II) heart failure.",
"     <br>",
"      IV: intravenous; AF: atrial fibrillation; N/A: not applicable; QRS: QRS duration; QT: QT interval; T-U: abnormal repolarization (T-U) waves; DCC: direct current cardioversion; NYHA: New York Heart Association; ACS: acute coronary syndrome.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Sources:",
"     <br>",
"      <ol>",
"       <li>",
"        Kowey PR, Dorian P, Mitchell LB, et al. Vernakalant hydrochloride for the rapid conversion of atrial fibrillation after cardiac surgery: a randomized, double-blind, placebo-controlled trial. Circ Arrhythm Electrophysiol 2009; 2:652.",
"       </li>",
"       <li>",
"        Roy D, Pratt CM, Torp-Pedersen C, et al. Vernakalant hydrochloride for rapid conversion of atrial fibrillation: a phase 3, randomized, placebo-controlled trial. Circulation 2008; 117:1518.",
"       </li>",
"       <li>",
"        Camm AJ, Capucci A, Hohnloser S, et al. A randomized active-controlled study comparing the efficacy and safety of vernakalant to amiodarone in recent onset atrial fibrillation. J Am Coll Cardiol 2011; 18:313.",
"       </li>",
"      </ol>",
"      <br>",
"       Reproduced from: European Heart Rhythm Association, European Association for Cardio-Thoracic Surgery, Camm AJ, et al. Guidelines for the management of atrial fibrillation: the Task Force for the Management of Atrial Fibrillation of the European Society of Cardiology (ESC). Eur Heart J 2010; 31:2369, by permission of Oxford University Press. Copyright &copy; 2010.",
"      </br>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
